def process_deque(d):
    if not d:
        return []
    max_values = []
    max_val = d.popleft()
    max_values.append(max_val)
    while d:
        if d[0] < max_val:
            max_val = d.popleft()
            max_values.append(max_val)
        elif d[-1] <= max_val:
            max_val = d.pop()
